import React from 'react'

import {BurgerWrapper} from './burgerstyled'


export default function Index({text, onClick, cost, skeleton, ...props}) {
    return (
        <BurgerWrapper onClick={onClick} style={{backgroundColor: `${skeleton ? 'rgba(0,0,0,0.2)' : ''}`}}>
            <span>{text}</span>
            <span>{cost}</span>
        </BurgerWrapper>
    )
}
